//  C++ 
import "DPI-C" function void set_riscv_regs(input logic[31:0] regs [32]);
import "DPI-C" function void set_pc(input int pc_val);
import "DPI-C" function void set_dnpc(input int dnpc_val);
import "DPI-C" function void check_commit(input bit over);
import "DPI-C" function void trap_handler(input int pc); // ? ebreak

module RK_DPI(
  input clock,
  input inst_over,
  input ebreak,
  input [31:0] pc,
  input [31:0] dnpc,
  input [31:0] regs [31:0]
);

  always @(posedge clock) begin
    if (inst_over) begin
      set_pc(pc);
      set_dnpc(dnpc);
      set_riscv_regs(regs);
      check_commit(1'b1);
      
      // ?? ebreak? C++ 
      if (ebreak) begin
        trap_handler(pc);
      end
    end else begin
      check_commit(1'b0);
    end
  end

endmodule
    

